import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';
import Home from './app/pages/Home';
import List from './app/pages/List';

class App extends Component {
  render() {
    return (
      <Router>
        <Switch>
          <Route path='/list'>
            <List></List>
          </Route>
          <Route path='/'>
            <Home></Home>
          </Route>
        </Switch>
      </Router>
    );
  }

}
export default App;
